import CardList from './CardList';
import React , {Component} from 'react';
import {robots} from './robots';
import SearchBox from './SearchBox';


class App extends Component {
		constructor() {
		super();
		this.state= {
				robots: robots,
				searchield: '',
		}
	}
	render() {
		return (
			<div className= 'tc'>
				<h1>Robofriends</h1>
				<SearchBox />
				<CardList robots ={this.state.robots}/>
			</div>
			);
	}
};

export default App;
